def main():
    x = int(input())
    x = list(str(x))
    for i in range(len(x)):
        if x[i] == '9':
            x[i] = '0'
        else:
            x[i] = str(9 - int(x[i]))
    x = int(''.join(x))
    print(x)

if __name__ == '__main__':
    main()

