def invert(x):
    if x == 0:
        return 0
    if x % 10 == 0:
        return invert(x // 10)
    else:
        return 10 - x % 10 + invert(x // 10)


x = int(input())
print(invert(x))

import sys

x = int(sys.stdin.readline().strip())

while True:
    if x == 0:
        break
    if x % 10 == 0:
        x = x // 10
    else:
        x = x * 10 + (9 - x % 10)
        x = x // 10

print(x)
